package com.thrive.common.testdata.pojos.user_details;

public class ClientCareerDetails {
	
	private String attitudeRadioLabel;
	private int futureTeamRadioLabel;
	private int futureAtCompanyRadioLabel;
	private int recommendedCompanyRadioLabel;
	private int satisfyCompanyRadioLabel;
	private int futureCompanyRadioLabel;
	private int futureIndustryRadioLabel;
	
	
	
	public ClientCareerDetails(String attitudeRadioLabel, int futureTeamRadioLabel,
			int futureAtCompanyRadioLabel, int recommendedCompanyRadioLabel, int satisfyCompanyRadioLabel,
			int futureCompanyRadioLabel, int futureIndustryRadioLabel) {
		super();
		this.attitudeRadioLabel = attitudeRadioLabel;
		this.futureTeamRadioLabel = futureTeamRadioLabel;
		this.futureAtCompanyRadioLabel = futureAtCompanyRadioLabel;
		this.recommendedCompanyRadioLabel = recommendedCompanyRadioLabel;
		this.satisfyCompanyRadioLabel = satisfyCompanyRadioLabel;
		this.futureCompanyRadioLabel = futureCompanyRadioLabel;
		this.futureIndustryRadioLabel = futureIndustryRadioLabel;
	}
	public String getAttitudeRadioLabel() {
		return attitudeRadioLabel;
	}
	public void setAttitudeRadioLabel(String attitudeRadioLabel) {
		this.attitudeRadioLabel = attitudeRadioLabel;
	}
	public int getFutureTeamRadioLabel() {
		return futureTeamRadioLabel;
	}
	public void setFutureTeamRadioLabel(int futureTeamRadioLabel) {
		this.futureTeamRadioLabel = futureTeamRadioLabel;
	}
	public int getFutureAtCompanyRadioLabel() {
		return futureAtCompanyRadioLabel;
	}
	public void setFutureAtCompanyRadioLabel(int futureAtCompanyRadioLabel) {
		this.futureAtCompanyRadioLabel = futureAtCompanyRadioLabel;
	}
	public int getRecommendedCompanyRadioLabel() {
		return recommendedCompanyRadioLabel;
	}
	public void setRecommendedCompanyRadioLabel(int recommendedCompanyRadioLabel) {
		this.recommendedCompanyRadioLabel = recommendedCompanyRadioLabel;
	}
	public int getSatisfyCompanyRadioLabel() {
		return satisfyCompanyRadioLabel;
	}
	public void setSatisfyCompanyRadioLabel(int satisfyCompanyRadioLabel) {
		this.satisfyCompanyRadioLabel = satisfyCompanyRadioLabel;
	}
	public int getFutureCompanyRadioLabel() {
		return futureCompanyRadioLabel;
	}
	public void setFutureCompanyRadioLabel(int futureCompanyRadioLabel) {
		this.futureCompanyRadioLabel = futureCompanyRadioLabel;
	}
	public int getFutureIndustryRadioLabel() {
		return futureIndustryRadioLabel;
	}
	public void setFutureIndustryRadioLabel(int futureIndustryRadioLabel) {
		this.futureIndustryRadioLabel = futureIndustryRadioLabel;
	}
	
	
	

}
